import React from "react";
import { Switch, Route, BrowserRouter as Router } from "react-router-dom";

import DefaultFashionista from "./pages/default_fashionista";
import DefaultFashionseeker from "./pages/default-fashionseeker";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={DefaultFashionista} />
          <Route exact path="/seeker" component={DefaultFashionseeker} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
